import React from 'react';
import { connect } from 'react-redux';
import { setToDeleteIndex } from '../../store/actions'
import { BtnDelete } from '../../components/molekules';

const RemovePokemon = (props) => <BtnDelete {...props} />

const mapDispatchToProps = (dispatch, { pokeIdx }) => ({
    onClick: () => dispatch(setToDeleteIndex(pokeIdx)),
})

export default connect(undefined,mapDispatchToProps)(RemovePokemon);
